import ProductCart from "../shared/ProductCart"
import { productsCartList } from "../../data/productsCartList"

const Products = () => {
    return (
        <section className="products">
            <div className="products-title-wrapper">
                <h2 className="products-title">Популярные товары:</h2>
                <a className="products-title-link" href="link">Все популярные товары</a>
            </div>
            <ul className="products-catalog">
                {productsCartList.map((item) =>
                    <ProductCart newElement={item.newElement} title={item.title} model={item.model} previousPrice={item.previousPrice} price={item.price} key={item.key}></ProductCart>
                )}
            </ul>
        </section>
    )
}

export default Products
